CREATE DATABASE JoyeriaCrisol
GO
USE JoyeriaCrisol
GO
CREATE TABLE EnSesion(
Id INT IDENTITY PRIMARY KEY,
UsuarioId INT
)
GO
CREATE TABLE TipoDocumentos(
Id INT IDENTITY PRIMARY KEY,
Descripcion VARCHAR(MAX),
FisicaOJuridica CHAR(1)
)
GO
CREATE TABLE TipoProductos(
Id INT IDENTITY PRIMARY KEY,
Nombre VARCHAR(MAX),
Descripcion VARCHAR(MAX)
)
GO
CREATE TABLE Categorias2(
Id INT IDENTITY PRIMARY KEY,
Nombre VARCHAR(MAX),
Descripcion VARCHAR(MAX)
)
GO
CREATE TABLE Categorias(
Id INT IDENTITY PRIMARY KEY,
Nombre VARCHAR(MAX),
Descripcion VARCHAR(MAX)
)
GO
CREATE TABLE Roles(
Id INT IDENTITY PRIMARY KEY,
Descripcion VARCHAR(MAX)
)
GO
CREATE TABLE Usuarios(
Id INT IDENTITY PRIMARY KEY,
UserName VARCHAR(MAX),
Contrasena VARCHAR(MAX),
RolId INT,
ActivoSN CHAR(1),
FechaAlta DATETIME,
CONSTRAINT Usuarios_Roles FOREIGN KEY (RolId) REFERENCES Roles(ID)
)
GO
CREATE TABLE Materiales(
Id INT IDENTITY PRIMARY KEY,
Nombre VARCHAR(MAX)
)
GO
CREATE TABLE Cotizaciones(
Id INT IDENTITY PRIMARY KEY,
Cotizacion FLOAT,
MaterialId INT,
Fecha DATETIME,
CONSTRAINT Cotizacion_Material FOREIGN KEY (MaterialId) REFERENCES Materiales(ID)
)
GO
CREATE TABLE Provincias (
Id INT PRIMARY KEY,
Nombre VARCHAR(MAX) NOT NULL
)
GO
CREATE TABLE Ciudades (
Id INT PRIMARY KEY,
Nombre VARCHAR(MAX) NOT NULL,
cp INT,
ProvinciaID INT ,
CONSTRAINT CIUDAD_PROVINCIA FOREIGN KEY (ProvinciaID) REFERENCES Provincias(ID)
)
GO
CREATE TABLE Proveedores(
Id INT IDENTITY PRIMARY KEY,
TipoDocumentoId INT,
NumeroDocumento FLOAT,
Nombre VARCHAR(MAX),
Apellido VARCHAR(MAX),
FechaNacimiento DATE,
FechaAlta DATETIME,
Calle VARCHAR(MAX),
NumeroCalle INT,
Departamento VARCHAR(MAX),
Barrio VARCHAR(MAX),
Piso INT,
Manzana INT,
Lote INT,
CiudadId INT,
Car_Telefono INT,
NumeroTelefono FLOAT,
Car_Celular INT,
NumeroCelular FLOAT,
ActivoSN CHAR(1),
UsuarioId INT,
Email VARCHAR(MAX),
FisicaOJuridica VARCHAR(MAX),
CONSTRAINT Proveedor_TipoDocumento FOREIGN KEY (TipoDocumentoId) REFERENCES TipoDocumentos(ID),
CONSTRAINT Proveedor_Ciudad FOREIGN KEY (CiudadId) REFERENCES Ciudades(ID),
CONSTRAINT Proveedor_Usuario FOREIGN KEY (UsuarioId) REFERENCES Usuarios(ID)
)
GO
CREATE TABLE Clientes(
Id INT IDENTITY PRIMARY KEY,
TipoDocumentoId INT,
NumeroDocumento FLOAT,
Nombre VARCHAR(MAX),
Apellido VARCHAR(MAX),
FechaNacimiento DATE,
FechaAlta DATETIME,
Calle VARCHAR(MAX),
NumeroCalle INT,
Departamento VARCHAR(MAX),
Barrio VARCHAR(MAX),
Piso INT,
Manzana INT,
Lote INT,
CiudadId INT,
Car_Telefono INT,
NumeroTelefono FLOAT,
Car_Celular INT,
NumeroCelular FLOAT,
ActivoSN CHAR(1),
UsuarioId INT,
Email VARCHAR(MAX),
FisicaOJuridica VARCHAR(MAX),
CONSTRAINT Cliente_TipoDocumento FOREIGN KEY (TipoDocumentoId) REFERENCES TipoDocumentos(ID),
CONSTRAINT Cliente_Ciudad FOREIGN KEY (CiudadId) REFERENCES Ciudades(ID),
CONSTRAINT Cliente_Usuario FOREIGN KEY (UsuarioId) REFERENCES Usuarios(ID)
)
GO
CREATE TABLE Ventas(
Id INT IDENTITY PRIMARY KEY,
Fecha DATETIME,
ClienteId INT,
Total FLOAT,
UsuarioId Int,
CONSTRAINT Venta_Cliente FOREIGN KEY (ClienteId) REFERENCES Clientes(ID)
)
GO
CREATE TABLE Pedidos(
Id INT IDENTITY PRIMARY KEY,
Fecha DATETIME,
ClienteId INT,
Seña FLOAT,
Total FLOAT,
UsuarioId Int,
CONSTRAINT Pedido_Cliente FOREIGN KEY (ClienteId) REFERENCES Clientes(ID)
)
GO
CREATE TABLE UnidadesDePeso(
Id INT IDENTITY PRIMARY KEY,
Nombre VARCHAR(MAX)
)
GO
CREATE TABLE Productos(
Id INT IDENTITY PRIMARY KEY,
Cod_Barra VARCHAR(MAX),
Nombre VARCHAR(MAX),
Foto image,
Precio FLOAT,
Utilidad FLOAT,
MaterialId INT,
Peso FLOAT,
Tamaño FLOAT,
Color VARCHAR(MAX),
ProveedorId INT,
StockMin INT,
StockMax INT,
TipoProductoID INT,
UnidadDePeso int,
CategoriaID INT,
StockODeTercero INT,
FechaAlta DATETIME,
CONSTRAINT Producto_Material FOREIGN KEY (MaterialId) REFERENCES Materiales(ID),
CONSTRAINT Producto_Proveedor FOREIGN KEY (ProveedorId) REFERENCES Proveedores(ID),
CONSTRAINT Producto_Categoria FOREIGN KEY (CategoriaID) REFERENCES Categorias(ID),
CONSTRAINT Producto_Categoria2 FOREIGN KEY (TipoProductoID) REFERENCES TipoProductos(ID),
CONSTRAINT Producto_UnidadDePeso FOREIGN KEY (UnidadDePeso) REFERENCES UnidadesDePeso(ID)
)
GO
CREATE TABLE MovimientosStock(
Id INT IDENTITY PRIMARY KEY,
Cantidad INT,
ProductoId INT,
Fecha DATETIME,
CONSTRAINT MovimientosStock_Producto FOREIGN KEY (ProductoId) REFERENCES Productos(ID)
)
GO
CREATE TABLE DetalleVentas(
Id INT IDENTITY PRIMARY KEY,
VentaId INT,
ProductoId INT,
Cantidad INT,
Precio FLOAT,
SubTotal FLOAT,
IVA FLOAT,
CONSTRAINT DetalleVenta_Venta FOREIGN KEY (VentaId) REFERENCES Ventas(ID),
CONSTRAINT DetalleVenta_Producto FOREIGN KEY (ProductoId) REFERENCES Productos(ID),
)
GO
CREATE TABLE DetallePedidos(
Id INT IDENTITY PRIMARY KEY,
PedidoId INT,
ProductoId INT,
Cantidad INT,
Precio FLOAT,
SubTotal FLOAT,
IVA FLOAT,
CONSTRAINT DetallePedido_Pedido FOREIGN KEY (PedidoId) REFERENCES Pedidos(ID),
CONSTRAINT DetallePedido_Producto FOREIGN KEY (ProductoId) REFERENCES Productos(ID),
)
GO
CREATE TABLE Compras(
Id INT IDENTITY PRIMARY KEY,
Fecha DATETIME,
ProveedorId INT,
Total FLOAT,
UsuarioId Int,
CONSTRAINT Compra_Cliente FOREIGN KEY (ProveedorId) REFERENCES Proveedores(ID)
)
GO
CREATE TABLE DetalleCompras(
Id INT IDENTITY PRIMARY KEY,
CompraId INT,
ProductoId INT,
Cantidad INT,
Precio FLOAT,
SubTotal FLOAT,
IVA FLOAT,
CONSTRAINT DetalleCompra_Compra FOREIGN KEY (CompraId) REFERENCES Compras(ID),
CONSTRAINT DetalleCompra_Producto FOREIGN KEY (ProductoId) REFERENCES Productos(ID)
)
GO
