CREATE PROCEDURE [dbo].[SP_ModificarProductos]
@id int,
@Cod_Barra varchar(max),
@Nombre varchar(max),
@Foto image,
@Precio float,
@Utilidad float,
@MaterialId int,
@Peso float,
@Tamaño float,
@Color varchar(max),
@ProveedorId int,
@StockMin int,
@StockMax int,
@TipoProductoID int,
@UnidadDePeso int,
@CategoriaId int,
@StockODeTercero int
AS
begin


Update Productos set Cod_Barra =@Cod_Barra,
nombre =@Nombre,
foto =@Foto,
precio =@Precio,
utilidad =@Utilidad,
MaterialId= @MaterialId,
peso =@Peso,
tamaño =@Tamaño,
color =@Color,
ProveedorId =@ProveedorId,
StockMin =@StockMin,
StockMax =@StockMax,
TipoProductoID = @TipoProductoID,
UnidadDePeso = @UnidadDePeso,
CategoriaID =@CategoriaId,
StockODeTercero =@StockODeTercero
where Id = @id

end
